import React, {useState, useEffect} from 'react';
import styles from './app.module.css'
import { BrowserRouter, Route, Routes  } from 'react-router-dom'
import HomePage from '../../components/HomePage/HomePage';
import Cart from '../../components/Cart';
import LoginPage from '../../components/LoginPage';
import HP from '../../components/HP';
import axios from 'axios';



const App = () => {
    const [auth, setAuth] = useState([])
    const [isLoggedIn, setIsLoggedIn] = useState(false)

    useEffect(() => {
        axios.get('http://localhost:3002/auth.json')
        .then(data =>console.log(data.data.auth[1][2]))
    })

    return (
        <div className={styles.container}>
            <BrowserRouter>
                <Routes>
                    <Route path="/login" exact element={<LoginPage setIsLoggedIn={setIsLoggedIn}/>} />
                    <Route path="/hp" exact element={<HP setIsLoggedIn={setIsLoggedIn}/>} />
                    <Route path="/" exact element={<HomePage/>} />
                    <Route path="/cart" exact element={<Cart/>} />
                </Routes>
            </BrowserRouter>
        </div>
    );
};

export default App;
